	(16, '94752153', 'Cittadinanza con 05 anni', NULL, NULL, 150.0000, 0.0000, 'no_image.png', 1, 7, '20', '30', '', '', '', '', NULL, 3, 0, '', NULL, NULL, NULL, '<p><strong>Elenco documentazione per i domanda\r\ndi cittadinanza italiana con 05 anni di residenza</strong></p><ul>\r\n<li>Permesso di soggiorno valido se scade\r\ncon ricevuta</li><li>Carta di identita valido</li><li>Codice fiscale/Tessera di sanitaria</li><li>Passaporto con valido</li><li>Stato di famiglia</li><li>Atto di notarieta di nascita\r\nrilasciato da tribunale in Italia</li><li>Atto di notorietà di penale, rilasciato da un\r\ntribunale in Italia, è valido per non più di sei mesi.</li><li>Certificato di casellaria rilasciato da un tribunale in Italia, è valido\r\nper non più di sei mesi.</li><li>Certificato di carica prendenti rilasciato da\r\nun tribunale in Italia, è valido per non più di sei mesi.</li><li><strong>Storico di residenza che\r\nprova 05 anni residenza continuativa</strong></li><li>Attestato di conoscenza della lingua\r\nitaliana non inferiore a levello B 1 o permesso di lungo periodo/illimitato</li><li>Versamento del contributo di € 250,00</li><li>Marca da bollo da 16 €</li><li>Spid id di richiedente</li><li>Reditto di ultimo tre anni</li><li>Risposta di 20 domanda</li></ul><p><strong>NB: Richiesta di\r\ncittadinanza italiana con 05 anni di residenza può fare chi ha permesso di\r\nsoggiorno per motivi di asilo e deve aver compiuto 5 anni dal decreto positivo\r\ndella commissione o decreto del giudice di tribunale.</strong></p>', 1, 'service', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'cittadinanza-con-05-anni', NULL, 0.0000, NULL, 0, 0, NULL, 0),
