	(18, '69814884', 'NASpI', NULL, NULL, 0.0000, 0.0000, 'no_image.png', 6, NULL, '', '', '', '', '', '', NULL, 1, 0, '', NULL, NULL, NULL, '<ul><li>Copia carta d\'identità e codice fiscale del richiedente.</li><li>Permesso di siggiorno in corso di valido(se richiedente è staniera)</li><li>Ricevuta di rinovo permesso di soggirno(se permesso di soggiorno scade)</li><li>Email del richiedente</li><li>Numero cellulare del richiedente</li><li>Iban del richidente</li><li>Ultima busta paga.</li><li>Lettera di licenziamento o UNILAV*</li><li>Contratto di lavoro (se la richiesta di <strong>NASpI</strong> avviene a scadenza contratto tempo determinato)</li></ul><p xss=removed><strong><u>বাংলা</u></strong></p><ul>\r\n<li>কার্তাদিআইদেনতিতা/রেসিডেন্সসার্টিফিকেট, কদেসিফিসকালে,  বিদেশিদেরক্ষেত্রেপারমেসোদিসৌজর্ন্য;</li><li>কাজের কন্ট্রাক পেপার,\r\nকাজ শেষহওয়ার লেটার/চিঠি, কাজ থেকে অব্যহতি দেয়ার চিঠি;</li><li>সর্বশেষ বোন্তাপাগা না থাকলে তার আগের মাসের বোস্তা পাগা;</li><li>ব্যাংক এর ইভান;</li><li>মোবাইনং\r\nও ইমেইল এড্রেস;</li></ul>', 1, 'service', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'naspi', NULL, 0.0000, NULL, 0, 0, NULL, 0),
	(19, '11935354', 'NASpI -Agricultura', NULL, NULL, 0.0000, 0.0000, 'no_image.png', 6, NULL, '', '', '', '', '', '', NULL, 1, 0, '', NULL, NULL, NULL, '<ul><li>Copia carta d\'identità e codice fiscale del richiedente.</li><li>Permesso di siggiorno in corso di valido(se richiedente è staniera)</li><li>Ricevuta di rinovo permesso di soggirno(se permesso di soggiorno scade)</li><li>Email del richiedente</li><li>Numero cellulare del richiedente</li><li>Iban del richidente</li><li>Tutti busta paga.</li><li>Contrtto di lavoro o UNILAV*</li><li>Per i lavoratori coniugati codice fiscale del coniuge </li></ul>', 1, 'service', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'naspi-agricultura', NULL, 0.0000, NULL, 0, 0, NULL, 0),
